import EventItem from "../components/EventItem";

function EventDetailPage() {
  return <EventItem />;
}

export default EventDetailPage;

export async function loader() {
  const res = await fetch("http://localhost:8080/events");

  if (!res.ok) {
    return;
  } else {
    const data = await res.json();
    return data;
  }
}
